try {
    let { obj, key, scopes } = msg.sub;
    let rs = [];
    let combineObj = [];
    let keyToFind = (key) ? key : 'id';
    if (Array.isArray(scopes)) {
        scopes.forEach(value => {
            let items = findNestedObj(obj, keyToFind, value);
            let flat = flatten(items);
            let fullFLat = flatten(obj);
            let parents = getParents(fullFLat, keyToFind, value);
            flat[0].parentId = parents[0].parentId;
            parents.shift();
            rs.push(parents.sort().reverse().concat(flat));
        });
    }
    combineObj = combineArrays(...rs);
    msg.sub = combineObj;
} catch (error) {
    msg.sub = null;
    msg.error = {
        hint: '',
        error: error.message
    }
}
return msg;

function findNestedObj(entireObj, keyToFind, valToFind) {
    let foundObj = [];
    JSON.stringify(entireObj, (_, nestedValue) => {
        if (nestedValue && nestedValue[keyToFind] === valToFind) {
            foundObj = nestedValue;
        }
        return nestedValue;
    });
    return [foundObj];
}

function flatten(arr, level = 0, filter = {}, parentId = null) {
    const filterKeys = Object.keys(filter);
    return arr.reduce((acc, { id, children, ...rest }) => {
        const flattenedChildren = children ? flatten(children, level + 1, filter, id) : [];
        const flattenedObject = { ...rest, id, level, parentId };
        if (filterKeys.every(key => flattenedObject[key] === filter[key])) {
            return [...acc, flattenedObject, ...flattenedChildren];
        }
        return acc.concat(flattenedChildren);
    }, []);
}

function getParents(flatObj, keyToFind, childId) {
    let parents = [];
    let child = flatObj.find(x => x[keyToFind] === childId);
    if (child) {
        parents.push(child);
        do {
            let parent = (child) ? flatObj.find(x => x.id === child.parentId) : [];
            if (parent) parents.push(parent);
            child = parent;
        }
        while (child && child.parentId != null);
    }
    return parents;
}

function combineArrays(...arrays) {
    const combinedArray = [].concat(...arrays);
    const uniqueObject = {};
    const uniqueArray = [];

    for (let obj of combinedArray) {
        const objString = JSON.stringify(obj);
        if (!uniqueObject[objString]) {
            uniqueObject[objString] = true;
            uniqueArray.push(obj);
        }
    }

    return uniqueArray;
}

