function validate(type, keys) {
    let valid = false;
    if (!type || !keys) return {
        valid,
        message: 'invalid parameters !'
    }
    if (!typeOptions.includes(type)) return {
        valid,
        message: 'invalid geoType !'
    }
    if (!Array.isArray(keys)) return {
        valid,
        message: 'keys must be an array !'
    }
    let [psm, estate, division, other] = keys;
    switch (type) {
        case 'psm':
            if (keys.length != 0) return {
                valid,
                message: 'to get psm set keys as empty array!'
            }
            return { valid: true };
        case 'estate':
