                valid,
                message: 'to get road set psm, estate, division on keys!'
            }
            return { valid: true };
        case 'tree':
            if (!psm || !estate || !division || !other || keys.length != 4) return {
                valid,
                message: 'to get road set psm, estate, division, & block on keys!'
            }
            return { valid: true };
    }
