function validate(type, keys) {
    let allowedType = ['psm', 'estate', 'division', 'block', 'road'];
    let valid = false;
    let message;
    if (allowedType.includes(type)) {
        if (Array.isArray(keys)) {
            switch (type) {
                case 'psm':
                    if (keys.length == 0) valid = true;
                    else {
                        message = 'keys must be empty to get all PSM'
                    }
                    break;
                case 'estate':
                    if (keys.length == 1) valid = true;
                    else {
                        message = 'set PSM if type = estate'
                    }
                    break;
                case 'division':
                    if (keys.length == 2) valid = true;
                    else {
                        message = 'set PSM & Estate if type = division'
                    }
                    break;
                case 'block':
                    if (keys.length == 3) valid = true;
                    else {
                        message = 'set PSM, Estate, and division if type = block'
                    }
                    break;
                case 'road':
                    if (keys.length == 3) valid = true;
                    else {
                        message = 'set PSM, Estate, and division if type = road'
                    }
                    break;
            }
        } else {
            message = 'keys must be an array !'
        }
    } else {
        message = 'type is not allowed !'
    }

    return { valid, message }
}

